import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import TablePagination from '@mui/material/TablePagination';

const DataBase = () => {
    const [data, setData] = useState(null);
    const [filteredData, setFilteredData] = useState(null);
    const [selectedDate, setSelectedDate] = useState(null);
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(10);
    const location = useLocation();
    const { info } = location.state || {};

    useEffect(() => {
        fetchDataFromBackend();
    }, []);

    useEffect(() => {
        filterDataByDate();
    }, [data, selectedDate]);

    const fetchDataFromBackend = async () => {
        try {
            const response = await fetch('http://localhost:80/guardados');
            if (response.ok) {
                const jsonData = await response.json();
                setData(jsonData);
            } else {
                console.error('Error al obtener datos desde el backend:', response.status);
            }
        } catch (error) {
            console.error('Error de red:', error);
        }
    };

    const filterDataByDate = () => {
        if (!selectedDate) {
            setFilteredData(data);
        } else {
            const filtered = data.filter(item => {
                // Suponiendo que cada objeto en `data` tiene una propiedad `fecha` que contiene la fecha en formato 'YYYY-MM-DD'
                return item.fecha === selectedDate;
            });
            setFilteredData(filtered);
        }
    };

    const handleDateChange = (event) => {
        setSelectedDate(event.target.value);
    };

    const handleChangePage = (event, newPage) => {
        setPage(newPage);
    };

    const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    return (
        <div style={{ padding: '20px' }}>
            <h1 style={{ marginBottom: '20px' }}>Base de Datos</h1>
            <div style={{ marginBottom: '20px' }}>
                <label htmlFor="dateFilter">Filtrar por fecha:</label>
                <input type="date" id="dateFilter" value={selectedDate} onChange={handleDateChange} />
            </div>
            <TableContainer component={Paper}>
                <Table stickyHeader aria-label="sticky table">
                    <TableHead>
                        <TableRow>
                            <TableCell>productUrl</TableCell>
                            <TableCell>baseUrl</TableCell>
                            <TableCell>mimeType</TableCell>
                            <TableCell>nombre</TableCell>
                            <TableCell>fecha_login</TableCell>
                            <TableCell>correo_electronico</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {filteredData && filteredData
                            .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                            .map((row, index) => (
                                <TableRow key={index}>
                                    <TableCell>{row.productUrl}</TableCell>
                                    <TableCell>{row.baseUrl}</TableCell>
                                    <TableCell>{row.mimeType}</TableCell>
                                    <TableCell>{row.nombre}</TableCell>
                                    <TableCell>{row.fecha_login}</TableCell>
                                    <TableCell>{row.correo_electronico}</TableCell>
                                </TableRow>
                            ))}
                    </TableBody>
                </Table>
            </TableContainer>
            <TablePagination
                rowsPerPageOptions={[10, 25, 100]}
                component="div"
                count={filteredData ? filteredData.length : 0}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handleChangePage}
                onRowsPerPageChange={handleChangeRowsPerPage}
            />
        </div>
    );
};

export default DataBase;
